const url = 'http://10.0.0.12/api/usuario/consulta.php';

var request = new XMLHttpRequest()

request.open('GET', 'http://10.0.0.12/api/usuario/consulta.php', true)

request.onload = function () {
  var data = JSON.parse(this.response)

  console.log(data)
}

request.send()
